import React from "react";
import { makeStyles } from "@material-ui/core/styles";
import { Link, Box } from "@material-ui/core";
import logo from "../images/logo.png";
import AppBar from "@material-ui/core/AppBar";
import Toolbar from "@material-ui/core/Toolbar";
import IconButton from "@material-ui/core/IconButton";
import AccountCircle from "@material-ui/icons/AccountCircle";
import CallIcon from "@material-ui/icons/Call";
import MenuIcon from "@material-ui/icons/Menu";
import WhatsAppIcon from "@material-ui/icons/WhatsApp";
import EmailIcon from "@material-ui/icons/Email";
import TwitterIcon from "@material-ui/icons/Twitter";
import InstagramIcon from "@material-ui/icons/Instagram";

const useStyles = makeStyles((theme) => ({
  menuButton: {
    marginRight: theme.spacing(2),
    display: "none",
    [theme.breakpoints.down("sm")]: {
      display: "block",
    },
  },
  logo: {
    maxWidth: 100,
    maxHeight: 24,
    display: "block",
    [theme.breakpoints.down("sm")]: {
      display: "none",
    },
  },
  icons: {
    fontSize: "17px",
    color: "#fafafa",
  },
}));

function Wiget() {
  const classes = useStyles();
  const icons = [
    {
      id: 1,
      iconLink: "#",
      name: <CallIcon className={classes.icons} />,
    },
    {
      id: 2,

      iconLink: "#",
      name: <WhatsAppIcon className={classes.icons} />,
    },
    {
      id: 3,

      iconLink: "#",
      name: <EmailIcon className={classes.icons} />,
    },
    {
      id: 4,

      iconLink: "#",
      name: <TwitterIcon className={classes.icons} />,
    },
    {
      id: 5,

      iconLink: "#",
      name: <InstagramIcon className={classes.icons} />,
    },
  ];

  return (
    <AppBar color='secondary' position='fixed'>
      <Toolbar variant='dense'>
        <IconButton
          edge='start'
          className={classes.menuButton}
          color='inherit'
          aria-label='menu'
        >
          <MenuIcon />
        </IconButton>

        <Link href='#'>
          <img className={classes.logo} src={logo} alt='passaggregate' />
        </Link>

        <div style={{ width: "100%" }}>
          <Box display='flex' justifyContent='center'>
            {icons.map((icon) => (
              <Link href='#'>
                <IconButton>key=icon{icon.name}</IconButton>
              </Link>
            ))}
          </Box>
        </div>

        <IconButton>
          <AccountCircle className={classes.icons} />
        </IconButton>
      </Toolbar>
    </AppBar>
  );
}

export default Wiget;
